import React from 'react';

const ContactFormWithMap = () => {
  return (
    <div style={{ fontFamily: 'Arial, sans-serif', padding: '20px' }}>
      <h2>Επικοινωνήστε μαζί μας</h2>
      <form
        style={{ maxWidth: '500px', marginBottom: '40px' }}
        onSubmit={(e) => {
          e.preventDefault();
          alert("Η φόρμα υποβλήθηκε (dummy)");
        }}
      >
        <label>
          Όνομα:<br />
          <input type="text" name="name" style={{ width: '100%', padding: '8px', marginBottom: '10px' }} required />
        </label><br />
        <label>
          Email:<br />
          <input type="email" name="email" style={{ width: '100%', padding: '8px', marginBottom: '10px' }} required />
        </label><br />
        <label>
          Μήνυμα:<br />
          <textarea name="message" rows="5" style={{ width: '100%', padding: '8px', marginBottom: '10px' }} required />
        </label><br />
        <button type="submit" style={{ padding: '10px 20px' }}>Αποστολή</button>
      </form>

      <h3>Βρείτε μας στον χάρτη</h3>
      <iframe
        title="Google Maps"
        width="100%"
        height="400"
        frameBorder="0"
        style={{ border: 0 }}
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3145.5407824995715!2d23.7348!3d37.9755!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMzfCsDU4JzMxLjgiTiAyM8KwNDQnMDUuMyJF!5e0!3m2!1sen!2sgr!4v1234567890"
        allowFullScreen=""
        loading="lazy"
      ></iframe>
    </div>
  );
};

export default ContactFormWithMap;
